// Natural sort: numbers before letters
function naturalSort(a, b) {
  const regex = /^\d+/;
  const aMatch = a.match(regex);
  const bMatch = b.match(regex);

  if (aMatch && bMatch) {
    return parseInt(aMatch[0]) - parseInt(bMatch[0]);
  } else if (aMatch) {
    return -1;
  } else if (bMatch) {
    return 1;
  } else {
    return a.localeCompare(b);
  }
}

