function loadNeighborList(file, bypassPrompt = false) {
  window._lastNeighborRaw = file;

  Papa.parse(file, {
    header: true,
    skipEmptyLines: true,
    complete: (results) => {
      const rawHeaders = Object.keys(results.data[0] || {});
      const headerMap = {};
      rawHeaders.forEach(h => {
        headerMap[h.trim().toLowerCase()] = h;
      });

      if (!bypassPrompt && !validateNeighborHeaders(rawHeaders)) {
        return; // will trigger prompt
      }

      const customMap = JSON.parse(localStorage.getItem("customNeighborHeaderMapping") || "{}");

      window.neighborColumnMap = {};

      for (const [std, aliases] of Object.entries(window.expectedNeighborHeaders)) {
        if (['source_cell_id', 'target_cell_id', 'type', 'handover_att'].includes(std)) {
          // For GUI-mapped fields (exclude handover_att from custom mapping logic)
          if (std !== 'handover_att' && customMap[std] && headerMap[customMap[std].toLowerCase()]) {
            window.neighborColumnMap[std] = headerMap[customMap[std].toLowerCase()];
            continue;
          }

          // Try matching from aliases
          for (const alias of aliases) {
            const found = headerMap[alias.toLowerCase()];
            if (found) {
              window.neighborColumnMap[std] = found;
              break;
            }
          }
        }
      }

      // Set default only if not mapped
      if (!window.neighborColumnMap.type) {
        console.warn("‚ö†Ô∏è 'type' column not found ‚Äî using default value 'intra'");
        window.neighborColumnMap.type = "__default_intra";
      }

      if (!window.neighborColumnMap.handover_att) {
        console.warn("‚ö†Ô∏è 'handover_att' column not found ‚Äî using default value 0");
        window.neighborColumnMap.handover_att = "__default_0";
      }

      console.log("‚úÖ Neighbor header mapping:", window.neighborColumnMap);
      neighborList = results.data;
      alert(`Loaded ${neighborList.length} neighbor pairs.`);
    }
  });
}




function getDistanceKm(lat1, lng1, lat2, lng2) {
  const R = 6371; // Earth radius km
  const dLat = (lat2 - lat1) * Math.PI / 180;
  const dLng = (lng2 - lng1) * Math.PI / 180;
  const a = Math.sin(dLat/2) * Math.sin(dLat/2) +
            Math.cos(lat1 * Math.PI/180) * Math.cos(lat2 * Math.PI/180) *
            Math.sin(dLng/2) * Math.sin(dLng/2);
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
  return R * c;
}

