function isIndoorRow(row) {
  const type = (row?.[columnMap.type] || "").toLowerCase();
  const selectedCol = indoorColumnSelect?.value?.trim();
  const selectedVals = Array.from(indoorValueSelect?.selectedOptions || []).map(o => o.value.trim());
  const val = (row?.[selectedCol] || "").toString().trim();
  return (
    (selectedCol && selectedVals.includes(val)) ||
    indoorValues.includes(type)
  );
}

function drawConnectionLineFromOuterEdge(sourceRow, targetRow, attempts = 0) {
  const deg2rad = deg => deg * Math.PI / 180;

  const offsetWithAzimuth = (row, radius) => {
    const lat = row.__lat__;
    const lng = row.__lng__;
    const az = row.__azimuth__ ?? 0;
    const angle = deg2rad(az);
    return [
      lat + radius * Math.cos(angle),
      lng + radius * Math.sin(angle) / Math.cos(deg2rad(lat))
    ];
  };

  const getIndoorTriangleEdgeMidpoint = (row, radius) => {
    const lat = row.__lat__;
    const lng = row.__lng__;
    const az = row.__azimuth__ ?? 0;
    const beam = row.__beamwidth__ ?? 60;

    const offset = (angleDeg) => {
      const angle = deg2rad(angleDeg);
      return [
        lat + radius * Math.cos(angle),
        lng + radius * Math.sin(angle) / Math.cos(deg2rad(lat))
      ];
    };

    const a1 = az - beam / 2;
    const a2 = az + beam / 2;
    const p1 = offset(a1);
    const p2 = offset(a2);

    return [
      (p1[0] + p2[0]) / 2,
      (p1[1] + p2[1]) / 2
    ];
  };

  if (!sourceRow || !targetRow) return;

  const lat1 = sourceRow.__lat__;
  const lng1 = sourceRow.__lng__;
  const lat2 = targetRow.__lat__;
  const lng2 = targetRow.__lng__;
  if (isNaN(lat1) || isNaN(lng1) || isNaN(lat2) || isNaN(lng2)) return;

  const baseRadius = parseFloat(indoorRadiusSlider?.value) || 0.0003;
  const baseDeg = radiusSlider?.value > 0 ? radiusSlider.value / 100 : zoomToDegRadius(map.getZoom());
  const stepOutdoor = (sectorLayerStepPercentage / 100) * baseDeg;
  const stepIndoor = (layerStepPercentage / 100) * baseRadius;

  const getOuterRadius = (row) => {
    const idx = row.__layerIndex__ ?? 0;
    if (isIndoorRow(row)) {
      return idx === 0 ? baseRadius : baseRadius + (idx - 1) * stepIndoor + stepIndoor;
    } else {
      return idx === 0 ? baseDeg : baseDeg + (idx - 1) * stepOutdoor + stepOutdoor;
    }
  };

  const sourceRadius = getOuterRadius(sourceRow);
  const targetRadius = getOuterRadius(targetRow);

 const start = isIndoorRow(sourceRow)
  ? getIndoorTriangleOuterEdgeMidpoint(sourceRow, sourceRadius)
  : offsetWithAzimuth(sourceRow, sourceRadius);

const end = isIndoorRow(targetRow)
  ? (targetRow.__triangleEdgeMidpoint__ || getIndoorTriangleOuterEdgeMidpoint(targetRow, targetRadius))
  : offsetWithAzimuth(targetRow, targetRadius);


    // Determine style based on attempts
  const attempt = parseInt(attempts);
  let neighlinecolor = "#666", neighlineweight = 3, neighlinedashArray = "4, 4";

  for (const range of attemptColorRanges) {
    if (attempt <= range.max) {
      neighlinecolor = range.color;
      neighlineweight = range.weight ?? 3;
      neighlinedashArray = range.dashArray ?? "4, 4";
      break;
    }
  }

const dashArrayMap = {
  solid: null,
  dashed: "6,4",
  dotted: "2,4",
  "dash-dot": "6,4,2,4",
  "long-dash": "12,6",
  "short-dash": "4,2",
  "tight-dots": "1,2",
  "dash-gap-dot": "8,4,2,4"
};

const style = attemptColorRanges.find(r => attempts <= r.max) || {};
const color = style.color || "#666";
const dashArray = dashArrayMap[style.dash || "solid"];
const weight = style.weight || 2;

const line = L.polyline([start, end], {
  color,
  weight,
  opacity: 0.7,
  dashArray,
   renderer: connectionRenderer,
   pane: 'connectionPane'  // ‚úÖ Ensures line is always on top
});



  connectionLineGroup.addLayer(line);
  sectors.push(line);
}

function getIndoorTriangleOuterEdgeMidpoint(row, outerRadius) {
  const deg2rad = deg => deg * Math.PI / 180;
  const lat = row.__lat__;
  const lng = row.__lng__;
  const az = row.__azimuth__ ?? 0;
  const beam = row.__beamwidth__ ?? 60;

  // Use same angle used in triangle generation
  const aLeft = az - beam / 2;
  const aRight = az + beam / 2;

  const offset = (angleDeg) => {
    const angle = deg2rad(angleDeg);
    return [
      lat + outerRadius * Math.cos(angle),
      lng + outerRadius * Math.sin(angle) / Math.cos(deg2rad(lat))
    ];
  };

  const leftOuter = offset(aLeft);
  const rightOuter = offset(aRight);

  return [
    (leftOuter[0] + rightOuter[0]) / 2,
    (leftOuter[1] + rightOuter[1]) / 2
  ];
}

function getAttemptColor(att) {
  const attempt = parseInt(att);
  if (isNaN(attempt)) return "#666"; // fallback

  for (const range of attemptColorRanges) {
    if (attempt <= range.max) {
      return range.color;
    }
  }
  return "#666"; // fallback
}

