function mergeExternalMetrics(externalRows, joinKey) {
  const joinColumnInMain = columnMap[joinKey]; // e.g. 'siteid' or 'cellid'
  if (!joinColumnInMain) {
    alert("Join key column not found in main data.");
    return;
  }

  if (!externalRows || externalRows.length === 0) {
    alert("External data is empty.");
    return;
  }

  const externalHeaders = Object.keys(externalRows[0]);
  const expectedList = window.expectedHeaders[joinKey]; // from your global mapping
  const externalJoinCol = getBestHeaderMatch(externalHeaders, expectedList);

  if (!externalJoinCol) {
    alert(`‚ö†Ô∏è Could not find a matching '${joinKey}' column in external file.\nExpected one of: ${expectedList.join(", ")}`);
    return;
  }

  // Build lookup map from external file
  const externalMap = {};
  for (const row of externalRows) {
    const key = (row[externalJoinCol] || "").trim().toUpperCase();
    if (key) externalMap[key] = row;
  }

  // Perform merge
  let mergeCount = 0;
  sectorData.forEach(row => {
    const mainKey = (row[joinColumnInMain] || "").trim().toUpperCase();
    const external = externalMap[mainKey];
    if (external) {
      for (const [k, v] of Object.entries(external)) {
        if (k !== externalJoinCol && k.trim() && v !== undefined) {
          row["*__" + k.trim()] = v;
        }
      }
      mergeCount++;
    }
  });

  alert(`‚úÖ Merged ${mergeCount} rows using key: ${joinKey} (matched on '${externalJoinCol}')`);
}

