function getSectorFillColor(row, layerIndex) {
  if (!thematicColumn) return getColorForLayer(layerIndex);
  const value = row[thematicColumn];
  if (value == null) return getColorForLayer(layerIndex);
  // === CATEGORICAL MODE ===
  if (thematicMode === "categorical") {
    const valStr = value.toString().trim();
    return categoryColorMap[valStr] || getColorForLayer(layerIndex);
  }
  // === RANGE MODE ===
  if (thematicMode === "range") {
    const val = parseFloat(value.toString().replace(/[^\d.-]/g, ""));
    if (!isNaN(val)) {
      for (const range of thematicClassRanges) {
        if (val >= range.min && val < range.max) {
          return range.color;
        }
      }
    }
    return getColorForLayer(layerIndex);
  }
  // === CONTINUOUS MODE ===
  if (thematicMode === "continuous") {
    const val = parseFloat(value.toString().replace(/[^\d.-]/g, ""));
    if (!isNaN(val)) {
      const pct = (val - thematicRange[0]) / (thematicRange[1] - thematicRange[0]);
      return thematicColorScale(Math.max(0, Math.min(1, pct))).hex();
    }
    return getColorForLayer(layerIndex);
  }
  return getColorForLayer(layerIndex); // fallback if mode is unrecognized
}

function generateDistinctHSLColors(n, saturation = 70, lightness = 50) {
  const colors = [];
  const hueStep = 360 / n;
  for (let i = 0; i < n; i++) {
    const hue = Math.round((i * hueStep) % 360);
    colors.push(`hsl(${hue}, ${saturation}%, ${lightness}%)`);
  }
  return colors;
}

function shuffleArray(array) {
  for (let i = array.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [array[i], array[j]] = [array[j], array[i]];
  }
}

function getBestHeaderMatch(headers, expectedList) {
  const lowerHeaders = headers.map(h => h.toLowerCase().trim());
  for (const expected of expectedList) {
    const idx = lowerHeaders.indexOf(expected.toLowerCase());
    if (idx !== -1) return headers[idx]; // return original case
  }
  return null;
}

function pointInPolygon(latlng, polygon) {
  const x = latlng.lat;
  const y = latlng.lng;
  const latlngs = polygon.getLatLngs()[0];

  let inside = false;
  for (let i = 0, j = latlngs.length - 1; i < latlngs.length; j = i++) {
    const xi = latlngs[i].lat, yi = latlngs[i].lng;
    const xj = latlngs[j].lat, yj = latlngs[j].lng;

    const intersect = ((yi > y) !== (yj > y)) &&
                      (x < (xj - xi) * (y - yi) / (yj - yi + 0.00000001) + xi);
    if (intersect) inside = !inside;
  }

  return inside;
}

